description:
Subjects Addressed:
(1) The ancient Passover service teaches deliverance from the bondage of sin.
(2) The destructive nature of Chikungunya and Ebola diseases may kill 5 million people.
(3) Populous cities will be reduced to ruin and desolation. Diseases and calamities will become more and more frequent and disastrous. {GC 589.3} 
(4) United States government apparently are putting many more people at risk to contract the Ebola disease and other diseases.
(5) Bill Gates: “The world today has 6.8 billion people... that's headed up to about 9 billion. Now if we do a really great job on new vaccines, health care, reproductive health services, we could lower that by perhaps 10 or 15 percent.”
(6) People are being quarantined if suspected of the Ebola disease.
(7) If you refuse to be vaccinated against communicable diseases, the government sees you as a threat and perhaps isolate you from the public indefinitely.
(8) Government’s solutions to these health crises will bring Seventh-day Adventists to the test. {2SM 53.3} 
(9) God’s professed people should now become intelligent in regard to disease, its causes, prevention, and cure.
(10) “The great deceiver will persuade men that those who serve God are causing these evils.” {GC 590.1}
(11) Just before probation closed on the Jewish nation, Jesus cleansed the temple twice.
(12) “He [Jesus] knew that His efforts to reform a corrupt priesthood would be in vain...”  {DA 590.3} 
(13) “It would be poor policy to support from the treasury of God those who really mar and injure His work, and who are constantly lowering the standard of Christianity.”  {3T 553.2}  
(14) “There are fearful woes for those who preach the truth, but are not sanctified by it, and also for those who consent to receive and maintain the unsanctified to minister to them in word and doctrine."  {1T 261.3}
(15) “Are we hoping to see the whole church revived? That time will never come.”  {1SM 122.1}  
(16) “In cleansing the temple from the world's buyers and sellers, Jesus announced His mission to cleanse the heart from the defilement of sin,--from the earthly desires, the selfish lusts, the evil habits, that corrupt the soul.”  {DA 161.1}
